import React from 'react';
import '../components/css/Shoplist.css';  
const shopsData = [
  { id: 1, name: 'AMB MAll', level: 'Level 1', location: 'near Food Court', contact: '' },
  { id: 2, name: 'AMAZING ', level: 'Level 2', location: 'near INOX', contact: '(225) 888-4120' },
];

const ShopsList = () => {
  return (
    <div className="shops-container">
      <h2>Stores & Restaurants</h2>
      <div className="filter">
        <span>Filter</span>
        <select>
          <option value="all">All Stores</option>
          <option value="level1">Level 1</option>
          <option value="level2">Level 2</option>
        </select>
      </div>
      <div className="shops-list">
        {shopsData.map(shop => (
          <div key={shop.id} className="shop-item">
            <div className="shop-image">
              {/* Placeholder for store logo or image */}
              <img src="../" alt={shop.name} />
            </div>
            <div className="shop-info">
              <h3>{shop.name}</h3>
              <p>{shop.level}, {shop.location}</p>
              {shop.contact && <p>{shop.contact}</p>}
              <button className="details-button">Details</button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ShopsList;
